    "inputText": "Permian Gastroenterology Associates LLP\n315 E 5th Street, Odessa, TX 79761\nRavikumar P. Vemuru, M.D.\nSyam Vemulapalli, M.D.\nBoard certified in Gastroenterology and Internal medicine.\nPATIENT NAME:  XXX\t\t\t\t\t\t        MRNO:\nDATE OF BIRTH:  XXX\nDATE OF VISIT:  XXX\nREFERRING PHYSICIAN:  Dr. Joe Wallace.\nCHIEF COMPLAINT:  Elevated liver function tests.\nHISTORY OF PRESENT ILLNESS:  The patient is a 40-year-old female who has a known history of chronic elevation of liver function tests.  She was diagnosed with a steatohepatitis in 1998.  Since then, she did not have any further workup.  She also has uncontrolled diabetes and is very noncompliant with the medications.  She presently denies any abdominal pain.  No history of any nausea or vomiting.  The patient is presently being considered for insulin treatment.  Her total bilirubin was 3.4 and her ALT was 51.  The liver biopsy in 1998 showed a steatohepatitis with some fibrosis.\nPAST MEDICAL HISTORY:\nAnxiety and depression.\nDiabetes.\nHypertension.\nSOCIAL HISTORY:  The patient denies any alcohol or smoking.\nFAMILY HISTORY:  Negative for any GI malignancies.\nCURRENT MEDICATIONS:  Include:\nMetformin.\nLisinopril.\nAdvil.\nDarvocet.\nMEDICATION ALLERGIES:\nThe patient is allergic to PENICILLIN.\nREVIEW OF SYSTEMS:\nGENERAL:  Denies any unusual weakness, fatigue, or fever.\nSKIN:  No rashes or skin lesions.\nHEENT:  Head:  Negative for history of head injury, headache, or dizziness.\nEYES:  No recent change in vision.  Denies blurring of vision or diplopia.\n?\nXXX\t\t\t\t\t\t\t\t\t\t\t   PAGE TWO\nXXX\nEARS:  Negative for tinnitus, vertigo, or earaches.\nNOSE:  Negative for hay fever, nasal discharge, and nasal stuffiness.\nTHROAT:  Negative for sore throat or hoarseness.\nNECK:  No swollen glands, lumps, pain, or stiffness.\nRESPIRATORY:  Negative for cough, sputum production, hemoptysis, or shortness of breath.\nCARDIOVASCULAR:  No dyspnea, orthopnea, chest pain, or palpitations.\nGASTROINTESTINAL:  Appetite is good.  Negative for dysphagia, odynophagia, nausea, vomiting, indigestion, diarrhea, or constipation.  No abdominal pain.  Bowel movements are regular.  No hematochezia or melena.\nGENITOURINARY:  Positive for urinary frequency.  No dysuria, hematuria, or urinary incontinence.\nPERIPHERAL VASCULAR:  No history of phlebitis or leg pain.  Negative for intermittent claudication.\nMUSCULOSKELETAL:  Positive for muscle cramps.  Denies arthralgia, injury, or swelling.  Denies any muscle stiffness, arthritis, gout, backache, or limitation of motion or activity.\nNEUROLOGICAL:  No fainting, seizures, motor, or sensory loss.  Long-term and short-term memory is intact.  Denies frequent headaches, weakness of the extremities, or slurring of the speech.\nPSYCHIATRIC:  No history of depression or treatment for psychiatric disorders.\nPHYSICAL EXAMINATION:\nVital signs:  Blood pressure:  124/78 mmHg.  Pulse:  84.  Temperature:  97.1.\nGeneral:  The patient is in no acute distress.  Alert, awake, and comfortable.\nHEENT:  Head:  Normocephalic and atraumatic.  Hair of average textures.  Scalp without lesions.\nSkin:  No infections, jaundice, rash, or petechiae.\nEyes:  Conjunctiva moist and pink.  PERRLA.\nEars:  Auditory, acuity good to whispered voice.\nNose:  Mucosa is pink.  No sinus tenderness.  No nasal discharge.\nMouth:  Oral mucosa is moist and pink.  No gingivitis.\nNeck:  Supple.  Trachea is midline.  No thyromegaly.  No lymphadenopathy.  Carotid, no bruits.\nHeart:  S1 and S2 regular.  No S3 or S4.  No murmurs.  No jugular vein distention.\nThorax:  Symmetric with good excursion.\nLungs:  Clear.  No rales, wheezing, or rhonchi.\nAbdomen:  Soft, nontender, and non-distended.  No masses.  No costovertebral angle tenderness.  Bowel sounds are active.\nPeripheral vascular:  Negative for ankle edema.  No stasis, pigmentation, or ulcers.  Radial pulses are 2+.  Dorsalis pedis 2+.\nMusculoskeletal:  No joint deformities.  Good range of motion.\nASSESSMENT:\nSteatohepatitis, certainly cirrhosis needs to be ruled out.\nUncontrolled diabetes.\n?\nXXX\t\t\t\t\t\t\t\t\t\t          PAGE THREE\nXXX\nPLAN:\nWe will obtain hepatitis panel, liver function tests, and also an ultrasound of the liver.\nThe patient was advised regarding weight loss and exercise.\nShe was also instructed regarding good glycemic control.\nFurther workup will be considered based on the above test results.  Most likely, we may consider a repeat liver biopsy, if the patient agrees.\nThank you Dr. Wallace for allowing us to participate in the care of this patient.\n______________________\nSyam Vemulapalli, M.D.\nRje/hma\ncc:\tDr. Wallace\nPhone: 432 333 3433\t\t\t\tFax: 432 333 3450\t\t\t\tEmail : Raviv @ aol.com\n",
